import * as React from 'react';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import ChevronRightIcon from '@mui/icons-material/ChevronRight';

function generate(element) {
  return [0, 1, 2].map((value) =>
    React.cloneElement(element, {
      key: value,
    }),
  );
}

const Demo = styled('div')(({ theme }) => ({
  backgroundColor: theme.palette.background.paper,
}));

export default function InteractiveList() {

  return (
    <Box sx={{ flexGrow: 1, maxWidth: 752 }}>
      <Grid container spacing={2}>
        <Grid item xs={12} md={6}>
          <Typography sx={{ mt: 4, mb: 2 }} variant="h6" component="div">
          ТРЕБОВАНИЯ ПРЕДЯВЛЯЕМЫЕ К КАНДИДАТАМ:
          </Typography>
          <Demo>
            <List dense={dense}>
                <ListItem>
                  <ListItemIcon>
                    <ChevronRightIcon />
                  </ListItemIcon>
                  <ListItemText
                    primary="ВОЗРАСТ ОТ 18 ЛЕТ"
                  />
                  
                </ListItem>
                <ListItem>
                  <ListItemIcon>
                    <ChevronRightIcon />
                  </ListItemIcon>
                  <ListItemText
                    primary="ПРОФПРИГОДНОСТЬ"
                  />
                  
                </ListItem>
                <ListItem>
                  <ListItemIcon>
                    <ChevronRightIcon />
                  </ListItemIcon>
                  <ListItemText
                    primary="ЗДОРОВЬЕ"
                  />
                  
                </ListItem>
                <ListItem>
                  <ListItemIcon>
                    <ChevronRightIcon />
                  </ListItemIcon>
                  <ListItemText
                    primary="ФИЗИЧЕСКИЕ ДАННЫЕ"
                  />
                  
                </ListItem>
                <ListItem>
                  <ListItemIcon>
                    <ChevronRightIcon />
                  </ListItemIcon>
                  <ListItemText
                    primary="ПРОХОЖДЕНИЕ ВОЕННОЙ СЛУЖБЫ ПО ПРИЗЫВУ РАНЕЕ, ЛИБО НАЛИЧИЕ СРЕДНЕГО
                    ПРОФЕССИАНАЛЬНОГО ИЛИ ВЫСШЕГО ОБРАЗОВАНИЯ   "
                  />
                  
                </ListItem>

            </List>
          </Demo>
        </Grid>
      </Grid>
      
        
    </Box>
  );
}
